import React from "react";
import { Modal } from "../UI/Modal";
import { CartItem } from "./CartItem";
import { styled } from "styled-components";

export const Cart = () => {
  return (
    <Modal>
      <Content>
        <CartList>
          <CartItem />
          <CartItem />
        </CartList>
      </Content>
    </Modal>
  );
};




const Content = styled("div")`
  padding: 1.5rem 1rem;
`;
const CartList = styled("ul")`
  list-style: none;
  display: flex;
  flex-direction: column;
  max-height: 360px;
  overflow-y: scroll;
`;
